import React from 'react';
import logo from './logo.svg';
import './App.css';

class FeedUrlForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      feedUrl: null,
    };
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.feedUrl);
    event.preventDefault();
  }

  andleChange(event) {
    this.setState({feedUrl: event.target.value});
  }


  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
        <label>
          Enter feed url:
          <input type="text" value={this.state.feedUrl} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Submit" />
      </form>
      </div>

    );
  }
}


function App() {
  return (
    <FeedUrlForm />

  );
}

export default App;
